def sqrt(number):


    if number**2 == number:
        return number
    low, high = 0, number
    while low <= high:
        m = (low + high) // 2
        if (m**2 == number) or (m**2 <= number and (m+1)**2 > number):
            return m
        elif (m**2 > number):
            high = m
        else:
            low = m

