	dy = abs(ay - by)
	return (dx + dy) * min(dx, dy)

def median(items):

    n = len(items)
    if not n:
        return None
    mid = n // 2
    items = sorted(items)
    if n % 2 == 0:
        return (items[mid - 1] + items[mid]) / 2
    return float(items[mid])

