def median(items):

    items = sorted(items)
    if len(items) < 1:
        return None
    if len(items) %2 == 1:
        return items[((len(items)+1)/2)-1]
    if len(items) %2 == 0:
        return float(sum(items[(len(items)/2)-1:(len(items)/2)+1]))/2.0

